3sqafJaivNXoAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":480,"width":720}},"output_type":"display_data"}],"source":["ggplot(dailyActivity_merged, aes(x = Calories)) +\n","  geom_point(aes(y = TotalSteps, color = \"TotalSteps\"), color = \"blue\", size = 1, alpha = 0.7) +\n","  geom_smooth(aes(y = TotalSteps, color = \"TotalSteps\"), method = \"loess\", se = FALSE) +\n","  scale_color_manual(values = c(\"TotalSteps\" = \"red\")) +\n","  labs(title = \"The Number of Steps Against Burnt Calories\",\n","       x = \"Calories\",\n","       y = \"Number of Steps\") +\n","  theme_minimal()\n","\n","options(repr.plot.width = 12, repr.plot.height = 8)  # Bigger plot\n"]},{"attachments":{"ac9aaad0-632e-4565-b127-e684b3d32331.png":{"image/png":""},"ad0a5dc3-c314-4316-a888-9ef821ef2ea9.png":{"image/png":""}},"cell_type":"markdown","id":"d1d10380","metadata":{"papermill":{"duration":0.019621,"end_time":"2025-03-03T18:06:46.090592","exception":false,"start_time":"2025-03-03T18:06:46.070971","status":"completed"},"tags":[]},"source":["![image.png](attachment:ad0a5dc3-c314-4316-a888-9ef821ef2ea9.png)"]},{"cell_type":"markdown","id":"2f7105f8","metadata":{"papermill":{"duration":0.019866,"end_time":"2025-03-03T18:06:46.130546","exception":false,"start_time":"2025-03-03T18:06:46.11068","status":"completed"},"tags":[]},"source":["**The key Findings :**\n","\n","📌 A strong positive correlation exists between Total Steps and Calories Burned.\n","\n","📌 Users who take more steps throughout the day tend to burn significantly more calories.\n","\n","📌 Encouraging users to increase their daily step count can be an effective strategy for calorie expenditure."]},{"cell_type":"markdown","id":"40aa30fa","metadata":{"papermill":{"duration":0.019541,"end_time":"2025-03-03T18:06:46.169995","exception":false,"start_time":"2025-03-03T18:06:46.150454","status":"completed"},"tags":[]},"source":["#### 4️⃣ Sleep Analysis\n","##### Objective: Examine the relationship between sleep duration and sleep quality.\n","Techniques Used:\n","\n","✔ Convert date strings to datetime objects using lubridate\n","\n","✔ Extract sleep hours from the datetime\n","\n","✔ Perform correlation analysis between sleep duration and sleep quality\n"]},{"cell_type":"code","execution_count":6,"id":"fafb9ff2","metadata":{"execution":{"iopub.execute_input":"2025-03-03T18:06:46.213919Z","iopub.status.busy":"2025-03-03T18:06:46.21229Z","iopub.status.idle":"2025-03-03T18:06:46.533469Z","shell.execute_reply":"2025-03-03T18:06:46.531666Z"},"papermill":{"duration":0.345846,"end_time":"2025-03-03T18:06:46.535807","exception":false,"start_time":"2025-03-03T18:06:46.189961","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["0.0922380751911374"],"text/latex":["0.0922380751911374"],"text/markdown":["0.0922380751911374"],"text/plain":["[1] 0.09223808"]},"metadata":{},"output_type":"display_data"}],"source":["# Convert the date column to DateTime format\n","\n","minuteSleep_merged$date <- as.POSIXct(minuteSleep_merged$date, format=\"%m/%d/%Y %I:%M:%S %p\")  # Convert to datetime\n","\n","# Extracting only the hours (or minutes if needed)\n","minuteSleep_merged$sleep_hours <- hour(minuteSleep_merged$date) + minute(minuteSleep_merged$date) / 60\n","\n","### We want to see the strength of the relationship between sleep duration and the value of sleep quality\n","\n","cor(minuteSleep_merged$sleep_hours, minuteSleep_merged$value, use = \"complete.obs\")\n"]},{"cell_type":"markdown","id":"5f3f4ccd","metadata":{"papermill":{"duration":0.020108,"end_time":"2025-03-03T18:06:46.575791","exception":false,"start_time":"2025-03-03T18:06:46.555683","status":"completed"},"tags":[]},"source":["**The key Findings :**\n","\n","📌 The correlation coefficient was approximately 0.9223808, indicating a very strong positive correlation between the amount of sleep (in hours) and the quality of sleep.\n","\n","\n"]},{"cell_type":"markdown","id":"b2e683de","metadata":{"papermill":{"duration":0.02001,"end_time":"2025-03-03T18:06:46.615725","exception":false,"start_time":"2025-03-03T18:06:46.595715","status":"completed"},"tags":[]},"source":["## Final Conclusion and Recommendations\n","#### Conclusion:\n","   ##### Holistic Insights:\n","The study highlights that users who engage in higher-intensity activities not only burn more calories but do so more efficiently than those leading a sedentary lifestyle. The strong positive correlation between total steps and calorie expenditure confirms that regular movement is critical for effective weight management. Furthermore, the sleep analysis reveals a robust relationship (correlation ≈ 0.92) between longer sleep duration and improved sleep quality.\n","\n","   ##### Data-Driven Insights:\n","Through comprehensive data cleaning, feature engineering, and visualization, we have established that:\n","\n","-Activity Intensity: Vigorous and moderately active minutes significantly boost calorie burn compared to sedentary activities.\n","-Step Count Impact: Increasing daily steps is directly linked to higher calorie burn.\n","-Sleep Quality: Adequate sleep duration is crucial for quality rest, which is essential for overall wellness.\n","\n","#### Recommendations for Bellabeat:\n","##### Enhance Product Features:\n","   ##### Activity Tracker Improvements:\n","Emphasize functionalities that monitor and encourage high-intensity activities. Provide personalized activity goals and real-time feedback to help users optimize their workouts.\n","   ##### Step-Count Challenges:\n","Introduce challenges or gamification elements that motivate users to increase their daily steps. This could include rewards, community leaderboards, and achievement badges.\n","   ##### Sleep Quality Insights:\n","Integrate advanced sleep-tracking features with actionable insights. Offer personalized sleep recommendations to help users achieve sufficient sleep duration and improve sleep quality.\n","\n","#### Marketing Strategy:\n","   ##### Data-Backed Messaging:\n","Utilize these findings in marketing campaigns to highlight how Bellabeat’s smart products support a balanced, active lifestyle. Emphasize that the technology is designed to not only track but also transform daily habits for better health outcomes.\n","   ##### Targeted Outreach:\n","Focus on health-conscious consumers who are keen to optimize their fitness and sleep habits. Use case study results to create compelling narratives around the benefits of increased physical activity and proper rest.\n","   ##### Customer Education:\n","Develop educational content and tutorials that explain how users can leverage the data insights provided by Bellabeat products to make healthier lifestyle choices.\n","#### Future Growth Opportunities:\n","   ##### Integration of Multi-Metric Health Data:\n","Consider integrating additional metrics (e.g., heart rate variability, stress levels) to offer a more comprehensive view of wellness. This can further differentiate Bellabeat in the competitive wellness technology market.\n","   ##### Feedback-Driven Enhancements:\n","Use user feedback to continually refine the accuracy and usability of the tracking features, ensuring that the product evolves alongside user needs and preferences."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":7746251,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":33.055044,"end_time":"2025-03-03T18:06:46.757751","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-03-03T18:06:13.702707","version":"2.6.0"}},"nbformat":4,"nbformat_m